import React from 'react';
import Navigation from './Navigation';
import './style.css';

class App extends React.Component {

    state = {
        contacts: []
    }

    componentDidMount() {
        fetch('http://jsonplaceholder.typicode.com/users')
        .then(res => res.json())
        .then((data) => {
          this.setState({ contacts: data })
        })
        .catch(console.log)
    }
    
    render() {
        return (
            <div>
                <Navigation />
                <div className="app">
              </div>
            </div>
        );
    };
}

export default App;
